webpackJsonp([0x9998da5edb4],{1226:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/front-end-web-development-books/index.md absPath of file >>> MarkdownRemark",html:'<p>A remarkable number of excellent books about Front End Web Development are freely available online, if you know where to look. Here\'s a collection of those that I\'ve discovered, and deigned to keep in my bookmarks.</p>\n<h2>Eloquent JavaScript:</h2>\n<p><a href="http://eloquentjavascript.net/">http://eloquentjavascript.net/</a>\n<a href="http://eloquentjavascript.net/"><img src="/content/images/2017/09/eloquent-javascript.png" alt="eloquent-javascript"></a></p>\n<h2>Learning JavaScript Design Patterns:</h2>\n<p><a href="https://addyosmani.com/resources/essentialjsdesignpatterns/book/">https://addyosmani.com/resources/essentialjsdesignpatterns/book/</a>\n<a href="https://addyosmani.com/resources/essentialjsdesignpatterns/book/"><img src="/content/images/2017/09/ljsdp.jpg" alt="ljsdp"></a></p>\n<h2>High Performance Web Sites:</h2>\n<p><a href="http://stevesouders.com/hpws/">http://stevesouders.com/hpws/</a>\n<a href="http://stevesouders.com/hpws/"><img src="/content/images/2017/09/hpws.jpg" alt="hpws"></a></p>\n<h2>High Performance Browser Networking:</h2>\n<p><a href="https://hpbn.co/">https://hpbn.co/</a>\n<a href="https://hpbn.co/"><img src="/content/images/2017/09/hpbn.jpg" alt="hpbn"></a></p>\n<h2>Designing for Performance:</h2>\n<p><a href="http://designingforperformance.com/">http://designingforperformance.com/</a>\n<a href="http://designingforperformance.com/"><img src="/content/images/2017/09/dfp.jpg" alt="dfp"></a></p>',frontmatter:{title:"A collection of free, online, Front End Web Development books.",date:"September 25, 2017",tags:null}}},pathContext:{}}}});
